d.x:
var $bm_rt;
var t = text.sourceText;
var l = t.length;
var a = effect('Animation')(1);
var b = effect('Cursor On/Off')(1);
var c = [
        '|',
        '_',
        '\u2014',
        '<',
        '>',
        '\xab',
        '\xbb',
        '^'
    ];
var d = effect('Cursor Shape')(1).value;
var reveal = t.slice(0, $bm_mul(l, linear(a, 0, 100, 0, 1)));
if (b == 0) {
    $bm_rt = reveal;
} else {
    $bm_rt = $bm_sum(reveal, c[$bm_sub(d, 1)]);
}

a.x:
var $bm_rt;
var b = effect('Cursor On/Off')(1);
var s = effect('Cursor Blink Speed')(1);
var blink = Math.sin($bm_mul($bm_mul(Math.PI, time), s));
if (b == 1) {
    $bm_rt = $bm_mul(blink >= 0, 100);
} else {
    $bm_rt = 0;
}

